import Dashboard from "./components/Dashboard";
import {Routes,Route,BrowserRouter} from 'react-router-dom'
import Login from "./components/Login";
import Formation from './components/Formation';
import Parent from "./components/Parent";
import Client from "./components/client/Client";
import EditCourse from "./components/EditCourse";
import Account from "./components/Account";
import Profile from "./components/profilePage/Profile";

const App = () => {


  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Client/>}></Route>
          <Route path="/signIn" element={<Login/>} ></Route>
          <Route path="/profile" element={<Profile/>}></Route>

          <Route path="/dashboard" element={<Dashboard/>} ></Route> 
          <Route path="/dashboard/formation" element={<Formation/>} ></Route> 
          <Route path="/dashboard/tableau" element={<Parent/>} ></Route> 
          <Route path="/edit-course/:id" element={<EditCourse/>}></Route>
          <Route path="/dashboard/account" element={<Account/>}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};
export default App;
